script: |
  super -f text -I q5500.spq | sort > q5500.out

inputs:
  - name: q5500.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN + CAST ( - col0 AS INTEGER ) * + - col1 + - - 64 + - col1 AND col0 * + col0 * + col2 + col1;
  - name: tab2

outputs:
  - name: q5500.out
    data: |
